import React from 'react';
import { NavLink } from 'react-router-dom';

const Home = () => {
  return (
    <div>
      <nav>
        <ul>
          <li><NavLink to="/cv">CV</NavLink></li>
          <li><NavLink to="/about">About</NavLink></li>
          <li><NavLink to="/contact">Contact</NavLink></li>
        </ul>
      </nav>
      <h1>Welcome to my website!</h1>
      <p>Here you can learn more about me and my work.</p>
      <section>
        <h2>My Projects</h2>
        <ul>
          <li><NavLink to="/project/1">Python Event Planner</NavLink></li>
          <li><NavLink to="/project/2">React Weather App</NavLink></li>
          <li><NavLink to="/project/3">Node.js Todo App</NavLink></li>
        </ul>
      </section>
    </div>
  );
}

export default Home;
